import React from 'react'
import ExerciseCard from './ExerciseCard';

function MyExercises() {
    return (
        <div>
            <ul className="cards">
            {exercises.slice(0, 10).map(exercise => 
                <ExerciseCard
                key={exercise.id}
                exercise={exercise}
                onExerciseClick={onAddExercise}
                />)}
        </ul>
        </div>
    )
}

export default MyExercises;
